import React from "react";
import styles from './index.module.scss';
import { TravelForm } from '../components/TravelForm';

class Information extends React.Component<any, any> {
    constructor(props) {
        super(props);
        this.state = {
            travelForm: Array(10).fill(''),
        };
    }

    change(e) {
        this.setState({travelForm: e.target.value})
    }

    renderTravelForm(i) {
        return (
            <TravelForm value={this.state.travelForm[i]} onChange={() => {this.change(i)}} />
        );
    }

    render() {
        return (
            <div>
                {this.renderTravelForm(0)}
            </div>
        );
    }
}

